import { Navbar, NavbarBrand, Container } from "reactstrap";

const NavBar = () => {
  return (
    <div>
      <Navbar style={{ backgroundColor: "#00523f" }}>
        <Container>
          <NavbarBrand href="/" style={{ color: "white" }}>
            Dompet Santri
          </NavbarBrand>
        </Container>
      </Navbar>
    </div>
  );
};

export default NavBar;
